import './App.scss';
import {Route, Routes} from "react-router-dom";
import {UserContextProvider} from "./UserContext";
import Layout from './components/Layout';


function App() {
  return (
    <UserContextProvider>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<h1>Index</h1>} />
          <Route path="/login" element={<h1>Login</h1>} />
          <Route path="/register" element={<h1>Register</h1>} />
          <Route path="/how-to" element={<h1>O co chodzi</h1>} />
          <Route path="/post/:id" element={<h1>Ogloszenie</h1>} />
          <Route path="/edit/:id" element={<h1>Edycja</h1>} />
          <Route path="/fundation" element={<h1>O co chodzi</h1>} />
          <Route path="/give" element={<h1>Oddaj dary</h1>} />
          <Route path="/info" element={<h1>Info</h1>} />
        </Route>
      </Routes>
    </UserContextProvider>
  );
}

export default App;
